function Table() {
  return (
    <Row>
      <table>
        <thead>
          <tr>
            <th>Status</th>
            <th>Date</th>
            <th>Client</th>
            <th>Currency</th>
            <th>Total</th>
            <th>Invoice</th>
            <th>Action</th>
          </tr>
        </thead>
      </table>
    </Row>
  );
}

export default Table;
